import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const Col_ThreeBlock = (props) => {
    return (
        <div className="text-left mx-auto" style={{ width: "18rem" }}>
            {/* Product Image */}
            <img
                className="card-img-top"
                src={props.img}
                alt="Product"
                style={{ height: "400px" }}
            />

            {/* Card Body */}
            <div className="card-body">
                {/* Product Title */}
                <h5 className="text-left pt-2" style={{ fontSize: "small" }}>
                    {props.product_name}
                </h5>

                {/* Price and Discount */}
                <div className="fw-bold text-left" style={{ fontSize: "17px" }}>
                    PKR {props.newprice}
                </div>

                {/* Add to Cart Button */}
                <button
                    className="btn mt-2"
                    style={{
                        backgroundColor: "white",
                        color: "black",
                        border: "2px solid black",
                    }}
                >
                    ADD TO BAG
                </button>

            </div>
        </div>
    );
};

const Three_Images = () => {
    return (
        <div className="container">
            <div className="row justify-content-center">
                {/* First Product */}
                <div className="col-md-4 d-flex justify-content-center">
                    <Col_ThreeBlock
                        img="https://www.junaidjamshed.com/media/catalog/product/2/5/25-3248_1_.jpg?width=436&height=560&canvas=436,560&optimize=medium&bg-color=255,255,255&fit=bounds"
                        product_name="Product 1"
                        newprice="1,000"
                    />
                </div>

                {/* Second Product */}
                <div className="col-md-4 d-flex justify-content-center">
                    <Col_ThreeBlock
                        img="https://www.junaidjamshed.com/media/catalog/product/2/5/25-3247_1_.jpg?width=436&height=560&canvas=436,560&optimize=medium&bg-color=255,255,255&fit=bounds"
                        product_name="Product 2"
                        newprice="1,200"
                    />
                </div>

                {/* Third Product */}
                <div className="col-md-4 d-flex justify-content-center">
                    <Col_ThreeBlock
                        img="https://www.junaidjamshed.com/media/catalog/product/2/5/25-3246_1_.jpg?width=436&height=560&canvas=436,560&optimize=medium&bg-color=255,255,255&fit=bounds"
                        product_name="Product 3"
                        newprice="1,500"
                    />
                </div>
            </div>
        </div>
    );
};

export default Three_Images;
